<?php

namespace Metrique\GoogleTaxonomy;

use Countable;
use Generator;
use IteratorAggregate;
use Metrique\GoogleTaxonomy\Enum\TaxonomyEnum;
use Metrique\GoogleTaxonomy\Exception\OutOfBoundsException;

class Taxonomy implements Countable, IteratorAggregate, TaxonomyInterface
{
    public function __construct(array $taxonomy = [])
    {
        if ($taxonomy) {
            $this->taxonomy = $taxonomy;
        }
    }

    public function lookup(TaxonomyEnum $key, string $value): array
    {
        foreach ($this->taxonomy as $taxonomy) {
            if (0 === strcasecmp($value, $taxonomy[$key->value])) {
                return $taxonomy;
            }
        }

        throw new OutOfBoundsException("No taxonomy found for {$key->value} {$value}");
    }

    public function lookupId(int $id): array
    {
        return $this->lookup(TaxonomyEnum::ID, $id);
    }

    public function lookupCategory(string $category): array
    {
        return $this->lookup(TaxonomyEnum::CATEGORY, $category);
    }

    public function search(string $query): array
    {
        return array_filter($this->taxonomy, function ($taxonomy) use ($query) {
            return stripos($taxonomy[TaxonomyEnum::CATEGORY->value], $query);
        });
    }

    public function all(): array
    {
        return $this->taxonomy;
    }

    public function count(): int
    {
        return count($this->taxonomy);
    }

    public function iterator(TaxonomyEnum $key = TaxonomyEnum::ID): Generator
    {
        foreach ($this->taxonomy as $taxonomy) {
            yield $taxonomy[$key->value] => $taxonomy;
        }
    }

    public function getIterator(): Generator
    {
        foreach ($this->taxonomy as $taxonomy) {
            yield $taxonomy;
        }
    }

